import React, { Component } from 'react';
import { link } from 'fs';

class  Counter extends Component {
    state = {
        count: 2,
        tags:['tag1','tag2','tag3']
    };
    styles = {
        fontSize:50,
        fontWeight:"bold"
    }
    renderTags(){
        if(this.state.tags.length===0) return 'There are no tags';
    }
    render() { 
        return (
        <div>
            <ul>
                {this.state.tags.map(tag=><li key={tag}>{tag}</li>)}
            </ul>
        </div>
        );
    }
}
 
export default Counter;
